    variant_with_conflict,
    variant_in_modal,
    can_solve,
    modal_open,

    closeModal
})=>{


    const {
        id,
        product_image: image_url,
        product_title: product_title,
        variant_price: price,
        variant_recommended_price, recommended:rpice,
        tax_calculated: calculated_duty = 0,
        calculated_duty_original = 0,
        priced_selected
    } = variant_in_modal

    const handleClose = () => {
        closeModal()
    }

    return (
        <Modal
        large
        open={modal_open}
        onClose={handleClose}
        title={'Resolver conflicto'}
        >
            
        </Modal>
    )

}

